import { FETCH_RENTALS, FETCH_RENTALS_BY_ID } from "./types";

const rentals = [
  {
    id: 1,
    title: "testing"
  },
  {
    id: 2,
    title: "oto"
  }
];

export const fetchRentals = () => dispatch => {
  //   return {
  //     type: FETCH_RENTALS,
  //     rentals
  //   };
  dispatch({ type: FETCH_RENTALS, rentals });
};

export const fetchRentalsById = id => dispatch => {
  dispatch({ type: FETCH_RENTALS_BY_ID });
};
